import React from 'react';
import './Main.css';
import Product from '../components/Product';
import images from '../images/acrap.jpg'

function Main() {

  const products = [
    { header: 'Товар 1', images: images, price: 120 },
    { header: 'Товар 1', images: images, price: 120 },
    { header: 'Товар 1', images: images, price: 120 },
    { header: 'Товар 1', images: images, price: 120 },
    { header: 'Товар 1', images: images, price: 120 },
    { header: 'Товар 1', images: images, price: 120 },
  ]

  return (
    <div className="Main">
      <Product images={images} />
      <Product images={images} />
      <Product images={images} />
      <Product images={images} />
      <Product images={images} />
      <Product images={images} />
    </div>
  );
}

export default Main;
